  return (
    <React.Fragment>
      <tr key={props.id}>
        <td>
          <button onClick={props.deleteTodayTask}></button>
        </td>
        <td>
          <input
            className={taskStyle.inputStyle}
            type="text"
            onChange={props.changed}
            value={props.tasks}
          />
        </td>
        <td>{props.task}</td>
      </tr>
      <p>{props.children}</p>
    </React.Fragment>
  );
};
